import React from "react";
import './style.css'


class Child extends React.Component {

    render() {
        return (
            <div>
                <input type="button" value="blue" style={{ backgroundColor: blue }}></input>
                <input type="button" value="red" style={{ backgroundColor: red }}></input>
                <input type="button" value="yellow" style={{ backgroundColor: yellow }}></input>
            </div>
        )
    }

}
export default Child
